INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES ("青空の下で謁見", 1, "フリーマーケット会場", 7, 8, 2834, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 5118061, 40, 10118, 20063115, 2, 91002, 0, "ペコリーヌとの出会い");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES ("未来の騎空団\nマスコット？", 1, "フリーマーケット会場", 7, 8, 2835, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 5118062, 40, 10118, 20063115, 2, 91002, 0, "マホとの出会い");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES ("お嬢さまからの\n緊急依頼", 1, "ランドソル市街地", 7, 8, 2837, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 5118063, 40, 10118, 20063115, 2, 91002, 0, "アキノとの出会い");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES ("黄金色の悩みごと", 1, "フリーマーケット会場", 18, 8, 4108402, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 5118064, 40, 10118, 20063115, 2, 91002, 0, "ジュンとの出会い");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES ("白熱！　格闘大会！", 1, "フリーマーケット会場", 18, 8, 4107402, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 5118065, 40, 10118, 20063115, 2, 91002, 0, "カオリとの出会い");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES ("祭り太鼓はオーエドの華", 1, "オーエド町", 16, 8, 9000227, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 5118066, 40, 10118, 20063115, 2, 91002, 1, "ニノンとの出会い");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES ("人気者は遅れて\nやってくる", 1, "フリーマーケット会場", 19, 8, 2101181, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 5118067, 40, 10118, 20063115, 3, 91002, 0, "スズナとの出会い");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES ("巫女・ミーツ・魔法少女", 1, "ランドソル市街地", 18, 8, 4109402, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 5118068, 40, 10118, 20063115, 3, 91002, 0, "ナナカとの出会い");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES ("ネズ耳は二度なくなる", 1, "フリーマーケット会場", 18, 8, 4305402, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 5118069, 40, 10118, 20063115, 3, 91002, 0, "キャル＆コッコロとの出会い");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES ("この出会いにカンパイ！", 1, "ランドソル市街地", 18, 8, 4101402, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 5118070, 40, 10118, 20063115, 3, 91002, 0, "ユカリとの出会い");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES ("陰陽アンサンブル", 1, "ランドソル市街地", 18, 8, 4106402, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 5118071, 40, 10118, 20063115, 3, 91002, 0, "アオイとの出会い");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES ("運試し十番勝負！", 1, "フリーマーケット会場", 7, 8, 2836, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 5118072, 40, 10118, 20063115, 3, 91002, 1, "シノブとの出会い");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES ("彼女たちの新たな日常", 0, 0, 0, 0, 0, 0, 5118600, 0, 10118, 20063115, 1, 0, 0, "オープニング");
